import React from "react";
import "../css/About.css";

function About(){
    return(
        <>
            <section id="About" class="container1">
           
            <div class="about">
                <br/>
                <br/>
                <h1 class="option">About Me</h1>
                <h3>I'm Nagababu</h3>
                <h5>Java Full stack Developer</h5>
                <p class="intro">A Full Stack developer skilled in creating and maintaining responsive and user-friendly websites, ensuring optimal performance and compatibility across devices and browsers. Proficient in HTML, CSS, JavaScript, React js ,Spring and various Full Stack development frameworks.</p>
                <span class="Abt">Email :</span> bnaga0245@gmail.com 
                <br/>
                <span class="Abt">place :</span> Hyderabad, India - 500055           
                <div class="res">
                    <a href="#icon">View Resume</a>
                </div>
                <br/>
            </div>
            </section>
        </>
    );
}


export default About;
